INSERT INTO `feriado` (`feriado_id`, `nome`, `descricao`, `data`, `feriado_tipo_id`, `data_de_criacao`, `status`) VALUES
(1, 'Ano Novo', 'O Ano-Novo ou Réveillon é um evento que acontece quando uma cultura celebra o fim de um ano e o começo do próximo. A celebração do evento é também chamada Réveillon, termo oriundo do verbo francês réveiller, que em português significa DESPERTAR', '2018-12-31', 1, '2018-11-28 17:37:26', 1),
(2, 'Natal', 'O Natal é comemorado anualmente em 25 de Dezembro. Originalmente destinado a celebrar o nascimento anual do Deus Sol no solstício de inverno, foi adaptado pela Igreja Católica no 3o século d.C., para permitir a conversão dos povos pagãos sob o domínio do Império Romano, passando a comemorar o nascimento de Jesus de Nazaré.', '2018-12-25', 1, '2018-11-28 17:38:10', 1);
